const StudentView = (props) => {
  const { student } = props;
  if (!student.campus){
    return(
      <div>
      <h1>{student.firstname + " " + student.lastname}</h1>
      <h3>{student.email}</h3>
      <img src="imgs/defaultperson.jpg" alt="Image"/>
      <p>{student.gpa}</p>
      <div>This student is currently not enrolled in a school.</div></div>
    );
  }
  return (
    <div>
      <h1>{student.firstname + " " + student.lastname}</h1>
      <h3>{student.email}</h3>
      <img src="imgs/defaultperson.jpg" alt="Image"/>
      <p>{student.gpa}</p>
      <h3>{student.campus.name}</h3>
      <div key={student.campus.id}>
          <Link to={`/campus/${student.campus.id}`}>
            <h1>{student.campus.name}</h1>
          </Link>
        </div>
    </div>
  );

};

export default StudentView;
